    "02_NW_award_ceremony": { "Identifier": "02_NW_award_ceremony", "Name": "2014, Isamu Akasaki, Physics", "Metadata": { "Description": "Physics Laureate Isamu Akasaki with his medal and diploma. Field: semiconductor technology; Created Efficient Blue LEDs: Light-emitting diodes (LEDs) has made more efficient light sources possible but blue LEDs proved to be much more difficult to create than red and green diodes. Isamu Akasaki successfully used the difficult-to-handle semiconductor gallium nitride to create efficient blue LEDs.", "DeepZoom": { "Path": "Collections\\award_ceremony\\02_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "02_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
