    "05_NW_award_ceremony": { "Identifier": "05_NW_award_ceremony", "Name": "2013, Peter H. Higgs, Physics", "Metadata": { "Description": "Physics Laureate Peter W. Higgs receiving his prize from H.M. King Carl XVI Gustaf. Field: particle physics;  The Discovery of the Higgs Particle: Independently of one another, in 1964 both Peter Higgs and the team of François Englert and Robert Brout proposed a theory about the existence of a particle that explains why other particles have a mass. In 2012, two experiments conducted at the CERN laboratory confirmed the existence of the Higgs particle.", "DeepZoom": { "Path": "Collections\\award_ceremony\\05_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "05_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "06_NW_award_ceremony": { "Identifier": "06_NW_award_ceremony", "Name": "2014, May-Britt Moser, Medicine", "Metadata": { "Description": "Physiology or Medicine Laureate May-Britt Moser receiving her prize from H.M. King Carl XVI Gustaf. Field: physiology, spatial behavior; Discovered the Brain's Positioning System: The awareness of one's location and how to find the way to other places is crucial for both humans and animals. In 2005 May-Britt Moser and Edvard I. Moser discovered a type of cell that is important for determining position close to the hippocampus, an area located in the center of the brain.", "DeepZoom": { "Path": "Collections\\award_ceremony\\06_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "06_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } }, 
