    "09_NW_award_ceremony": { "Identifier": "09_NW_award_ceremony", "Name": "2014, Stefan W. Hell, Chemistry", "Metadata": { "Description": "Chemistry Laureate Stefan W. Hell receiving his prize from H.M. King Carl XVI Gustaf. Field: physical chemistry; Developed Microscopy Method: In normal microscopes the wavelength of light sets a limit to the level of detail possible, but this limitation can be overcome by methods that make use of fluorescence. In 1994, Stefan W. Hell developed a method in which one light pulse causes fluorescent molecules to glow, while another causes all molecules except those in a very narrow area to become dark.", "DeepZoom": { "Path": "Collections\\award_ceremony\\09_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "09_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } }, 
    "10_NW_award_ceremony": { "Identifier": "10_NW_award_ceremony", "Name": "2014, John O'Keefe, Medicine", "Metadata": { "Description": "Physiology or Medicine Laureate John O'Keefe receiving his prize from H.M. King Carl XVI Gustaf. Field: physiology, spatial behavior; Discovered the Brain's Positioning System: The awareness of one's location and how to find the way to other places is crucial for both humans and animals. In 1971 John O'Keefe discovered the cells in a rat's brain that form a kind of internal map when the rat moves to another location in a room.", "DeepZoom": { "Path": "Collections\\award_ceremony\\10_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "10_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
