    "13_NW_award_ceremony": { "Identifier": "13_NW_award_ceremony", "Name": "2014, John O'Keefe, Banquet speech", "Metadata": { "Description": "Physiology or Medicine Laureate John O'Keefe delivering his banquet speech. Field: physiology, spatial behavior; Discovered the Brain's Positioning System: The awareness of one's location and how to find the way to other places is crucial for both humans and animals. In 1971 John O'Keefe discovered the cells in a rat's brain that form a kind of internal map when the rat moves to another location in a room.", "DeepZoom": { "Path": "Collections\\award_ceremony\\13_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "13_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
