    "17_NW_award_ceremony": { "Identifier": "17_NW_award_ceremony", "Name": "2013, Michael Levitt, Banquet speech", "Metadata": { "Description": "Chemistry Laureate Michael Levitt delivering his banquet speech. Field: biochemistry, physical chemistry, theoretical chemistry;  Taking Experiments to Cyberspace: The world around us is made up of atoms that are joined together to form molecules. During chemical reactions atoms change places and new molecules are formed. In the 1970s Michael Levitt successfully developed methods that combined quantum and classical mechanics to calculate the courses of chemical reactions using computers.", "DeepZoom": { "Path": "Collections\\award_ceremony\\17_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "17_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "18_NW_award_ceremony": { "Identifier": "18_NW_award_ceremony", "Name": "2014, Royal family banquet entrance", "Metadata": { "Description": "Nobel Laureates entering with the Royal family", "DeepZoom": { "Path": "Collections\\award_ceremony\\18_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "18_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "19_NW_award_ceremony": { "Identifier": "19_NW_award_ceremony", "Name": "2014, Patrick Modiano, Literature", "Metadata": { "Description": "Literature Laureate Patrick Modiano. Field: prose;  Depicts Memory, Oblivion and Identity: Good stories are often characterized by their exploration of universal but difficult questions, while at the same time being grounded in everyday settings and historical events. Patrick Modiano's works center around subjects like memory, oblivion, identity, and guilt in Paris during the World War II German occupation of France.", "DeepZoom": { "Path": "Collections\\award_ceremony\\19_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "19_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "20_NW_award_ceremony": { "Identifier": "20_NW_award_ceremony", "Name": "2013, Lars Peter Hansen, Economics", "Metadata": { "Description": "Economics Laureate Lars Peter Hansen. Field: econometrics, financial economics; Trendspotting in Asset Markets: For many of us, the rise and fall of stock prices symbolizes economic development. In 1982, Lars Peter Hansen developed a statistical method for testing Robert Shiller's theory that stock prices can be predicted over a longer period.  Hansen's method is now used within all economics research.", "DeepZoom": { "Path": "Collections\\award_ceremony\\20_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "20_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "21_NW_award_ceremony": { "Identifier": "21_NW_award_ceremony", "Name": "2013, James E. Rothman, Medicine", "Metadata": { "Description": "Physiology or Medicine Laureate James E. Rothman with Countess Alice Victoria Trolle-Wachtmeister. Field: biochemistry, cell physiology; Mapping of the Cell's Transport System: Many of the molecules produced by the cells in our body are grouped together in tiny sac-like structures called vesicles for transport to specific locations. During the 1980s and 1990s, James Rothman showed how vesicles fuse with specific surfaces in the cell so that transports arrive at the correct destination.", "DeepZoom": { "Path": "Collections\\award_ceremony\\21_NW_award_ceremony\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Award_Ceremony\\" + "21_NW_award_ceremony.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },

