    "dip7": { "Identifier": "dip7", "Name": "Mario Vargas Llosa, Literature, 2010", "Metadata": { "Description": "Mario Vargas Llosa's Nobel Diploma for his Nobel Prize in Literature 2010. It reads: \"The Swedish Academy has at its assembly on October 7, 2010 in accordance with the directions in the will drawn up by on November 27, 1895 by Alfred Nobel decided that the Nobel Prize in Literature shall be awarded to Mario Vargas Llosa, 'for his cartography of structures of power and his trenchant images of the individual's resistance, revolt, and defeat'. Stockholm, December 10, 2010.\"", "DeepZoom": { "Path": "Collections\\Diplomas\\dip7\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Diplomas\\" + "07_NW_coll_diplomas.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
