    "dip43": { "Identifier": "dip43", "Name": "Patrick Modiano , Literature, 2014", "Metadata": { "Description": "Patrick Modiano's Nobel Diploma for his Nobel Prize in Literature 2014. It reads: \"The Swedish Academy has at its assembly on October 7, 2014 in accordance with the directions in the will drawn up on November 27, 1895 by Alfred Nobel decided that the Nobel Prize in Literature shall be awarded to Patrick Modiano, for the art of memory with which he has evoked the most ungraspable human destinies and uncovered the life-world of the occupation. Stockholm, December 10, 2014.\"", "DeepZoom": { "Path": "Collections\\Diplomas\\dip43\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Diplomas\\" + "2014_10-PatrickModiano-highres.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
    "dip44": { "Identifier": "dip44", "Name": "Jean Tirole, Economics, 2014", "Metadata": { "Description": "Jean Tirole's Nobel Diploma for The Sveriges Riksbank Prize in Economic Sciences in Memory of Alfred Nobel in 2014. It reads: \"The Royal Swedish Academy of Sciences has on October 13, 2014 decided to award the prize in economic sciences in memory of Alfred Nobel established by The Sveriges Riksbank in 1968 to Jean Tirole for his analysis of market power and regulation. Stockholm, December 10, 2014.\"", "DeepZoom": { "Path": "Collections\\Diplomas\\dip44\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Diplomas\\" + "2014_12-JeanTirole-highres.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },  


