    "17_factories": { "Identifier": "17_factories", "Name": "Production", "Metadata": { "Description": "The factories often used gravity by placing the nitration houses highest up on a hill, for example, as at the factory in Ardeer. From there, the nitroglycerin and waste acids ran downhill through lead pipes to the separators and washhouses. After that, the nitroglycerin was transported to other buildings for further processing.", "DeepZoom": { "Path": "Collections\\Factories\\17_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "17_factories.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } }, 
    "18_factories": { "Identifier": "18_factories", "Name": "Nitration", "Metadata": { "Description": "During the nitration process, it is extremely important that the temperature never exceeds 180 degrees centigrade. The worker responsible for watching the thermometer sat on a one-legged stool to keep him from falling asleep. Photograph from the dynamite factory in Ardeer.", "DeepZoom": { "Path": "Collections\\Factories\\18_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "18_factories.jpg" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
