        "academy_of_sciences_new":{"Identifier": "academy_of_sciences_new","Metadata":{"DeepZoom":{"Path":"Images\\Prize\\academy_of_sciences_new\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["<title>Royal Academy of Sciences", " ", "In the 19th century, the Royal Swedish Academy of Sciences and the Museum of Natural History were located in Westmanska Palatset in Stockholm. In the early 20th century, the Academy moved to its present location north of the city.","<image>Images\\Prize\\telegram.tif","Telegram from the legal advisor Carl Lindhagen saying: 'All the academies have accepted.'"]},
