        "academy_new":{"Identifier": "academy_new","Metadata":{"DeepZoom":{"Path":"Images\\Prize\\academy_new\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["In the 19th Century the Swedish Academy did not have a permanent home. Its annual ceremonial meetings took place in the Stock Exchange building in the Old Town of Stockholm. Since the early 20th Century the Stock Exchange building is the permanent home of the Academy. Presently the Nobel Museum is also located in the building.","<image>Images\\Prize\\telegram.tif","Telegram from the legal advisor Carl Lindhagen saying: 'All the academies have accepted.'"]},
