        "sohlman": { "Identifier": "sohlman", "Metadata": { "DeepZoom": { "Path": "Images\\FromWillToPrize\\sohlman\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Ragnar Sohlman", " ", "Ragnar Sohlman (1870–1948) was Alfred Nobel’s assistant during the years 1893–96. He began his career with Nobel in Paris, and later also worked with Nobel in San Remo, as well as at Nobel’s experimental laboratory in Bofors, Sweden from 1896–97."] },

        //Family
        "3_ludvig_nobel": { "Identifier": "3_ludvig_nobel", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_ludvig_nobel\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Ludvig Nobel", " ", "Like his brother Alfred, Ludvig Nobel regularly visited spas and resorts, where the brothers often met."]},
        "3_painting_mine": { "Identifier": "3_painting_mine", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_painting_mine\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Immanuel Nobel's Painting", " ", "Following his return to Sweden around 1860, Immanuel Nobel made a number of watercolor drawings and sketches showing his mines. He also depicted a demonstration of his mines in presence of Russian military officers."] },
        "3_robert_family": { "Identifier": "3_robert_family", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_robert_family\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Robert Nobel's Family", " ", "Robert Nobel and his family and household, after they had settled at Getå, his estate outside Norrköping, Sweden. Robert Nobel's wife Pauline is sitting to the right of him, their son Hjalmar is standing on the left and their son Ludvig is standing  the right. Their daughter Thyra is sitting at the right in the middle row and Ingeborg is sitting in the middle in the front row."] },
        "3_immanuel_nobel": { "Identifier": "3_immanuel_nobel", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_immanuel_nobel\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Immanuel Nobel", " ", "Immanuel Nobel (1801–72) was an inventor and engineer. In 1837, he moved to St. Petersburg, Russia, and managed to interest the Russian Czar in an idea for naval mines. After Russia’s defeat in the Crimean War, however, times became difficult for Immanuel Nobel. At the end of the 1850’s, he returned to Sweden together with some members of his family. His more realistic ideas included artificial rubber and a predecessor of plywood. Among his eccentric ideas is a system of  pipes to move coffins from inner-cities to burial sites outside of them."] },
        "3_branobel": { "Identifier": "3_branobel", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_branobel\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Branobel", " ", "The Nobel Brothers' oil fields in Baku, Azerbaijan."] },
        "3_andriette": { "Identifier": "3_andriette", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_andriette\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Andriette Nobel", " ", "Andriette Ahlsell married Immanuel Nobel in 1827. They had four sons who lived to adulthood. Andriette, the daughter of an accountant, managed to ensure financial stability for her family when Immanuel went bankrupt and moved to Russia. She ran a food store, fed and clothed her sons, and provided both emotional and educational support during the years when the famiy was separated."] },
        "3_painting_st_petersburg": { "Identifier": "3_painting_st_petersburg", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_painting_st_petersburg\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["At the English Embankment in St. Petersburg, boat passengers from Finland and Sweden disembarked."] },
        "3_nobel_family": { "Identifier": "3_nobel_family", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_nobel_family\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Nobel Family", " ", "Immanuel Nobel surrounded by his sons and colleagues. The Nobel brothers are in the front row: Robert at the left, Ludvig second from right, Alfred at far right."] },
        "3_heleneborg": { "Identifier": "3_heleneborg", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_heleneborg\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Heleneborg", " ", "Heleneborg Stockholm, site of explosion."] },
        "3_robert_nobel": { "Identifier": "3_robert_nobel", "Metadata": { "DeepZoom": { "Path": "Images\\Family\\3_robert_nobel\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title> Robert Nobel", " ", "Photograph of Robert Nobel taken at a studio in Stockholm."] },

        //Factories
        "detonator_4":{"Identifier": "detonator_4","Metadata":{"DeepZoom":{"Path":"Images\\Factories\\detonator_4\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["<title>Detonator"," ","The sketch shows detonation using a wooden detonator loaded with a charge of gunpowder. First, a hole was drilled in the ledge, and blasting oil poured into it through a pipe. A fuse was then inserted into the detonator, and it was filled with gunpowder and then plugged with a cork or stopper. The detonator was then partially submerged in the blasting oil, and the rest of the hole was filled with sand. The fuse could then be lit."]},
        "ardeer_4":{"Identifier": "ardeer_4","Metadata":{"DeepZoom":{"Path":"Images\\Factories\\ardeer_4\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["<title>Explosives Factories"," ","At the heart of an explosives factory was the production of nitroglycerin in production units called 'nitroglycerin hills'. This photograph shows a nitroglycerin hill at the factory in Ardeer, Scotland around 1880. The nitroglycerin hill utilized gravity, with the nitration houses located at the top of the hill. From there, the nitroglycerin and waste acids ran downhill through lead pipes to the separation and wash houses. After that, the nitroglycerin was transported to other buildings for mixing into explosives."]},
        "railroad_4":{"Identifier": "railroad_4","Metadata":{"DeepZoom":{"Path":"Images\\Factories\\railroad_4\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["<title>Panama Canal"," ","The construction of the Panama canal between the Atlantic and Pacific Oceans over the Isthmus of Panama. The engineer behind the Suez Canal, Fernand Lesseps, had drawn up the plans for the Panama Canal in the 1870s. Due to financial problems, construction on the canal was discontinued in the 1890’s. The French canal enterprise ended in failure. A new project under American direction was begun in 1906. The canal was completed in 1914."]},
        "industries_pic_4":{"Identifier": "industries_pic_4","Metadata":{"DeepZoom":{"Path":"Images\\Factories\\industries_pic_4\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["<title>Factory at Ardeer"," ","The Nobel's explosives factory at Ardeer, Scotland."]},
        "sohlman_4": { "Identifier": "sohlman_4", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\sohlman_4\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Ragnar Sohlman"," ", "Ragnar Sohlman (1870–1948) was Alfred Nobel’s assistant during the years 1893–96. He began his career with Nobel in Paris, and later also worked with Nobel in San Remo, as well as at Nobel’s experimental laboratory in Bofors, Sweden in 1896–97. In Alfred Nobel’s will, Sohlman, along with Rudolph Lilljequist, was appointed an executor of Nobel’s estate. It was largely due to Sohlman’s work that the Nobel Foundation could be established in 1900. Sohlman was the acting director of the Nobel Foundation during the period 1929–1946."] },
        "krummel_map": { "Identifier": "krummel_map", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\krummel_map\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Map of Krümmel"," ", "Map of the site of the explosives factory at Krümmel."] },
        "krummel_whole": { "Identifier": "krummel_whole", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\krummel_whole\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Krümmel Factory"," ", "Image of the site of the explosives factory at Krümmel."] },
