        "medicine_0": { "Identifier": "medicine_0", "Metadata": { "DeepZoom": { "Path": "Images\\Intro\\medicine_0\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Florence Nightingale"," ", "Florence Nightingale tending to wounded soldiers. Florence Nightingale was a British social reformer and statistician and is regarded as the mother of modern nursing."] },
