        //Homes
        "san_remo_1": { "Identifier": "san_remo_1", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\san_remo_1\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>San Remo", " ", "Alfred Nobel and Wilhelm Unge outside Villa Nobel in San Remo.", "Unge was an engineer with whom Nobel collaborated on weapons projects."] },
        "factory_in_ardeer": { "Identifier": "factory_in_ardeer", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\factory_in_ardeer\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Factory in Ardeer", " ", "Alfred Nobel often painted a bleak picture of the traveling life. This example is taken from a letter to Sofie Hess, written in the St. Enoch’s Station Hotel in Glasgow:", " ", "“It was decided that I should depart for London yesterday evening, but the train that carried me from the factory was so delayed that I could not make my connection, and because in this God-fearing and pious country no trains run on Sunday, I sit here forsaken and captive in a hotel that is so large it resembles a city neighborhood.”"] },
        "stockholm_painting": { "Identifier": "stockholm_painting", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\stockholm_painting\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["The Palace of Nobility Square, Stockholm, around 1840. Painting by Ferdinand Tollin."] },
        "petersburg": { "Identifier": "petersburg", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\petersburg\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["Nikolaevsky Bridge, St. Petersburg, viewed from the English Embankment. L.J. Jacottet from a drawing by J. Charlemagne. Painted lithograph, 1850s."] },
        "hamburg_germany": { "Identifier": "hamburg_germany", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\hamburg_germany\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["Engraving of Hamburg with St. Catherine's church in the background."] },

