        "fehrenbach_4": { "Identifier": "fehrenbach_4", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\fehrenbach_4\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>George D. Fehrenbach", " ", "George D. Fehrenbach was a young chemist who worked with Alfred Nobel for nearly two decades, starting with the small laboratory next to Nobel's Paris home and later moving to the laboratory in Sevran.  He became responsible for the laboratory and for helping to develop ballistite during his time there."] },
        "liedbeck_4": { "Identifier": "liedbeck_4", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\liedbeck_4\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Alarik Liedbeck (1834-1912)", " ", "Alarik Liedbeck became Alfred Nobel's chief technical assistant in the construction and operation of factories all over Europe.  The factory in Ardeer, Scotland was designed by Liedbeck and benefited substantially from his experience in the construction of earlier factories, including Heleneborg and Vinterviken. Liedbeck maintained close personal and technical ties with Nobel right up to the time of Nobel's death"] },

