    function getID(laur) {
        strings = []
        for (var p = 0; p < laur.prizes.length; p++) {
            var prize = laur.prizes[p]
            var string = "";
            if (laur.id) {
                string += laur.id;
            }
            if (prize.year) {
                string += prize.year
            }
            if (prize.category) {
                string += prize.category
            }

            strings.push(string)
            continue


            if (laur.born) {
                string += laur.born
            }
            if (laur.died) {
                string += laur.died
            }
            if (laur.bornCountryCode) {
                string += laur.bornCountryCode
            }
            if (laur.diedCountryCode) {
                string += laur.diedCountryCode
            }
            if (prize.year) {
                string += prize.year
            }
            if (prize.category) {
                string += prize.category
            }
            strings.push(string)
        }
        return strings
    }

